# Command Texts
# Start user command
start.user.command.text1=Че надо, ёпта?
start.user.command.text2=Соснул?
start.user.command.text3=Иди нахуй!
start.user.command.text4=Ошибся адресом, гендер.
start.user.command.text5=В шлюхе не нуждаюсь, иди лесом.
start.user.command.text6=Я трахал твою лали, а тебя сюда не звали!
start.user.command.text7=Похуйдей - потом пиши.
start.user.command.text8=Опять ты...
start.user.command.text9=Как же ты меня заебал.
start.user.command.text10=Не пиши мне, чмо!
start.user.command.text11=Ты слишком лох что бы я с тобой общался.
start.user.command.text12=Пососи потом проси.
start.user.command.text13=Опача, что за черт?!
start.user.command.text14=Я ослеп от твоей красоты... Умри и не пиши сюда.
start.user.command.text15=Мне не приятно с тобой общаться, не пиши мне.
start.user.command.text16=Ебал твою мать, что скажешь?
start.user.command.text17=Я живу как Telegram Bot, я умру как Telegram Bot, ты живешь как ебанный лох, ты умрешь как ебанный лох.
start.user.command.text18=Псина отсоси мой хуй, и делай это гууд.
start.user.command.text19=У меня есть бутылка, еще что то напишешь - в зад засуну.
start.user.command.text20=Наступлю тебе на ебало что бы оставить свой след.
